import { configureStore, getDefaultMiddleware } from '@reduxjs/toolkit';
import appReducer from './appSlice';

const middleware = [...getDefaultMiddleware()];
export default configureStore({
    reducer: {
        app: appReducer,
    },
    middleware
});
